  [],\n\t\"revision_timestamp\": \"2016-07-27T22:41:39.894071\",\n\t\"name\": \"an-evaluation-of-contaminant-exposure-of-three-endangered-bat-species-in-virginia\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"A background contaminant study was conducted
  on bat guano and insects in Virginia caves to determine the possibility of exposure
  of endangered species of bats in Virginia to organochlorine pesticides, organophosphate
  pesticides, and metals. The three endangered species of bats in Virginia are the
  gray bat (Mvotis arisescens), the Virginia big-eared bat (Plecotus townsendii) and
  the Indiana bat (Mvotis sodalis). Historic guano samples from a cave in Scott County,
  Virginia (Clinchport quadrangle, cave SP) tend to be higher in organochlorine compounds
  than recent samples from that cave, possibly indicating a source of exposure of
  these compounds to the bats has been eliminated. The study also provides data which
  can be used for future comparison in contaminant assessments in Virginia bats.\",\n\t\"license_title\":
